            <thead class="thead-dark">
                <tr>
                    <th scope="col">Id</th>
                    <th scope="col">Nome</th>
                    <th scope="col">Nota 1</th>
                    <th scope='col'>faltas</th>
                </tr>
                {props.tabela.map(dados => {
                    return (
                        <tr>
                            <th scope="row">{dados.Id}</th>
                            <td>{dados.Nome}</td>
                            <td>{dados.Notas}</td>
                            <td>{dados.Faltas}</td>
                        </tr>

                    )
                })
                }
            </thead>
            <tbody>
                {lista_todos}
            </tbody>
        </table>
    )
}
